/* ================= PARSE DUMP ================= */

const skins = dumpData.trim().split("\n").map(line=>{
const p = line.split("|").map(x=>x.trim());
return {
id:p[0],
hex:p[1],
name:p[2]
};
});


// ===== VARIABLES =====

let selectedTarget=null;
let selectedHave=null;
let pairs=[];


// ===== FILTER =====

function filterSkins(text, weapon){

return skins.filter(skin=>{
return skin.name.toLowerCase().includes(text.toLowerCase())
&& skin.name.includes(weapon);
});

}


// ===== SHOW DROPDOWN =====

function showResults(input, box, setter){

const weapon=document.getElementById("weaponSelect").value;
const value=input.value;

box.innerHTML="";

if(!weapon || !value) return;

const results=filterSkins(value, weapon);

results.forEach(item=>{

const div=document.createElement("div");
div.textContent=item.name;

div.onclick=()=>{
input.value=item.name;
setter(item);
box.innerHTML="";
};

box.appendChild(div);

});

}


// ===== INPUT EVENTS =====

const targetInput=document.getElementById("targetSearch");
const haveInput=document.getElementById("haveSearch");

targetInput.oninput=()=>{
showResults(targetInput,
document.getElementById("targetResults"),
i=>selectedTarget=i);
};

haveInput.oninput=()=>{
showResults(haveInput,
document.getElementById("haveResults"),
i=>selectedHave=i);
};


// ===== ADD PAIR =====

function addPair(){

if(!selectedTarget || !selectedHave) return;

pairs.push({
have:selectedHave,
target:selectedTarget
});

updateList();

targetInput.value="";
haveInput.value="";
selectedTarget=null;
selectedHave=null;

}


// ===== UPDATE LIST CARD STYLE =====

function updateList(){

const list=document.getElementById("pairList");

if(pairs.length===0){
list.innerHTML="<li>No pairs added</li>";
return;
}

list.innerHTML="";

pairs.forEach(p=>{

const li=document.createElement("li");
li.className="pair-card";

li.innerHTML=`
<span class="have">${p.have.name}</span>
<span class="arrow"> > </span>
<span class="target">${p.target.name}</span>
`;

list.appendChild(li);

});

}


// ===== RESET =====

function resetPairs(){
pairs=[];
updateList();
}


// ===== EXPORT =====

function exportPairs(){

if(pairs.length===0) return;

const lines=pairs.map(p=>`${p.have.id},${p.target.id}`);

const blob=new Blob([lines.join("\n")],{type:"text/plain"});
const a=document.createElement("a");

a.href=URL.createObjectURL(blob);
a.download="gun_list.txt";
a.click();

}